// Create a RDD of Users object
final case class Users(userID: Int, age: Int, gender: String, occupation: String, zipcode: String)

// read line by line from the `u.user` file in the HDFS and map it to the respective fields
val lines = sc.textFile("hdfs:///tmp/ml-100k/u.user").map(x => {val fields = x.split('|'); Users(fields(0).toInt, fields(1).toInt, fields(2), fields(3), fields(4))})

import sqlContext.implicits._

// Convert to a DataFrame
val usersDF = lines.toDF()

// Show the DataFrame
usersDF.show()
